import React from 'react';

function ClientTicket() {
  return (
    <div className="client-ticket" style={{ padding: '20px', direction: 'rtl' }}>
      <h2>תיק לקוח</h2>
      <p>כאן תוצג מערכת ניהול לקוחות – פרטים, היסטוריית שיחות ועוד.</p>
    </div>
  );
}

export default ClientTicket;
